            <p className = "footer-text">information only and do not constitute any form advice. HLS assumes no responsibility for the accuracy of any particular statement and</p>
            <p className = "footer-text">accepts no liability for any loss or damage which may arise from reliance on the information contained on this website</p>
            <p className = "footer-note">Copyright 2021 HLS</p>
            <p>aaaa</p>
        </div>
    )
}
export default Footer
